import React from "react";
// ////////////////////////////
import '../sass/components/feautureAdvance.styles.scss';

const FeautureAdvance =({img , text}) =>(
    <div className='feauture'>
        <img className='feauture__img' src={require(img)} />
        <p className="feauture__text">{text}</p>
    </div>
);

export default FeautureAdvance;
